--
-- Table structure for table `employment_analysis`
--

DROP TABLE IF EXISTS `employment_analysis`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `employment_analysis` (
  `analysis_id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT '分析ID',
  `student_id` bigint NOT NULL COMMENT '学生ID',
  `college_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '高校名称',
  `department_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '院系名称',
  `major_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '专业名称',
  `gender` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '性别',
  `employment_date` date DEFAULT NULL COMMENT '就业日期',
  `salary` decimal(12,2) DEFAULT NULL COMMENT '薪资',
  `location` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '工作地点',
  `employment_id` bigint unsigned NOT NULL COMMENT '就业信息ID',
  PRIMARY KEY (`analysis_id`) USING BTREE,
  KEY `fk_employment_analysis_employment_id` (`employment_id`),
  CONSTRAINT `fk_employment_analysis_employment_id` FOREIGN KEY (`employment_id`) REFERENCES `employment_info` (`employment_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=619 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='就业分析表';
/*!40101 SET character_set_client = @saved_cs_client */;

