/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `after_employment_info_insert` AFTER INSERT ON `employment_info` FOR EACH ROW BEGIN
    -- 插入新行到 employment_analysis 表，包括 employment_id 字段
    INSERT INTO employment_analysis (student_id, college_name, department_name, major_name, gender, employment_date, salary, location, employment_id)
    SELECT ds.student_id, ds.college_name, ds.department_name, ds.major_name, ds.gender, NEW.employment_date, NEW.salary, NEW.location, NEW.employment_id
    FROM departments_students ds
    WHERE ds.student_id = NEW.student_id AND NEW.status = '0';
END */;;
